import React, { Component } from 'react';

class MainCatComponent extends Component {
    render(){
        return(
            <div className="container-fluid">
                <table class="table table-hover">
                    <thead>
                        <tr>
                            <th>Library Catalog</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <th>Book Id</th>
                            <th>Title</th>
                            <th>in Stock</th>
                            <th>on Hold</th>
                        </tr>
                    </tbody>
                </table>
            </div>
        );
    }
}

export default MainCatComponent;
